import React from "react";

export default function NotFound() {
    return (
        <div className="container">
            <div className="row">
                <div className="col-12">
                    <h2 style={{marginTop:"100px", fontFamily:"Arial Black", textAlign: "center"}}>
                        Page Not Found!
                    </h2>
                </div>
            </div>
        </div>
    )
}
